import React from 'react';
const Rating=()=>{
    return(
        <div className="rating-container">
            <div className="percent attendance"> 
                <p className="text">Attendance</p>
                <div className="circle">
                    <p className="text-percent">90%</p>
                </div>
                <p className="text">Last Absence 2th May, 12:00P.M</p>
            </div>
            <div className="percent rating">

            </div>
        </div>
    )

}
export default Rating;
